import React, { Component } from 'react';
import Ticker from './components/Ticker'

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoaded: false,
            items: []
        }
    }

    render() {
        var { isLoaded, items } = this.state;

        if (!isLoaded) {
            return <div>Loading...</div>
        } else {
            return (
                <div className = 'App'>
                    <ul>
                        {items.map(item => (
                            <li key = {item.id}>
                                Name: {item.name} | Email: {item.email}
                            </li>
                        ))};
                    </ul>
                </div>
            );
        }
    }
}

export default App;
